import Head from 'next/head';
import Navbar from './Navbar';



const Layout = (props) => {
  return (
    <html>
      <Head>
        <title>Header Blog</title>
        <link rel="stylesheet" href="/css/global.css" />
      </Head>
      <body>
        <Navbar />
      </body>
    </html>
  );
};

export default Layout;
